var ROW = 7;
var COLUMNS = 15;

var base64emoticonsArr = [];
for (var key in base64emoticons) {
  base64emoticonsArr.push(base64emoticons[key]);
}

tinymce.PluginManager.add('emoticons', function (editor) {
  function renderHtml() {
    var emoticonsHtml = '';

    for (var i = 0; i < ROW; i++) {
      emoticonsHtml += '<tr>';
      for (var j = 0; j < COLUMNS; j++) {
        var index = i * COLUMNS + j;

        var emoticonUrl = base64emoticonsArr[index];
        emoticonsHtml += '\n            <td style="cursor: pointer;">\n              <img style="width:30px;height:30px;" src="' + emoticonUrl + '" />\n            </td>\n          ';
      }
      emoticonsHtml += '</tr>';
    }

    return '<table role="list" class="mce-grid">' + emoticonsHtml + '</table>';
  }

  editor.addButton('emoticons', {
    type: 'panelbutton',
    tooltip: 'Emoticons',
    panel: {
      role: 'application',
      autohide: true,
      html: renderHtml,
      onclick: function onclick(e) {
        var linkElm = editor.dom.getParent(e.target, 'img');
        if (linkElm) {
          editor.insertContent(linkElm.parentElement.innerHTML);
          this.hide();
        }
      }
    }
  });
});
